import React from 'react'
import {Link} from 'react-router-dom'

function Navbar() {
  return (
    <div className="movielist">
      <h3>A-Z</h3>
      <ul className="movieul">
        <li><Link to="#">Absentia</Link></li>
        <li><Link to="#">America Heroes</Link> </li>
        <li><Link to="#">Breaking Bad</Link></li>
        <li><Link to="#">Blacklist</Link></li>
        <li><Link to="#">Blindspot</Link></li>
        <li><Link to="#">Vikings</Link></li>
        <li><Link to="#">Game of Thrones</Link></li>
      </ul>
    </div>
  );
}

export default Navbar;
